import React from "react";
import image1 from "../../assets/slideImages/A.jpg";
import image2 from "../../assets/slideImages/B.jpg";

function Gallery() {
  return (
    <div>
      <p>Hello This is the gallery</p>
      <div>
        <img src={image2} alt="image2" />
      </div>
    </div>
  );
}

export default Gallery;
